        let queries = queryString.split("&");
        queries.forEach(function(query) {
            let pair = query.split("=");
            let key = decodeURIComponent(pair[0]);
            let value = decodeURIComponent(pair[1] || '');
            params[key] = value;
        });
    }
  item.json.body.params = params;
}

