    let number = items[i].json.body.phone;  // Assuming the input number is under 'phoneNumber' key
    let cleanNumber = number.toString().replace(/\D/g, '');

    let normalizedNumber;

    if (cleanNumber.startsWith('+91') && cleanNumber.length === 13) {
        normalizedNumber = cleanNumber;
    } else if (cleanNumber.startsWith('91') && cleanNumber.length === 12) {
        normalizedNumber = '+91' + cleanNumber.slice(2);
    } else if (cleanNumber.length === 10) {
        normalizedNumber = '+91' + cleanNumber;
    } else {
        normalizedNumber = '+'+cleanNumber;
    }

    results.push({
        json: {
            normalizedPhoneNumber: normalizedNumber
        }
    });
}

