const page_full_url = $('Set7').first().json.page_url;

// Mapping of webinarId to orientation_session_id
const webinarToOrientationMapping = {
    104: 74,
    105: 73,
    113: 80,
    110: 79,
    112: 78,
    109: 77,
    108: 76,
    111: 75,
};

// Function to get orientation_session_id based on webinarId
function getOrientationSessionId(url) {
    try {
        // Parse the URL using RegEx as a fallback in case URL class is unavailable
        const webinarIdMatch = url.match(/[?&]webinarId=([^&]+)/);
        if (!webinarIdMatch) {
            throw new Error("webinarId parameter is missing in the URL");
        }

        const webinarId = webinarIdMatch[1]; // Extract webinarId from the match
        if (webinarToOrientationMapping[webinarId]) {
            return webinarToOrientationMapping[webinarId];
        } else {
            throw new Error("Invalid webinarId");
        }
    } catch (error) {
        throw new Error("Failed to parse URL or extract webinarId: " + error.message);
    }
}

// Get the orientation session ID in n8n-compatible format
try {
    const orientation_session_id = getOrientationSessionId(page_full_url);
    return [
        {
            json: {
                orientation_session_id,
            },
        },
    ];
} catch (error) {
    return [
        {
            json: {
                error: error.message,
            },
        },
    ];
}

